import { useState, useEffect } from 'react';
import axios from 'axios';

export default function Insights() {
  const [insights, setInsights] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    const fetchInsights = async () => {
      try {
        setLoading(true);
        const res = await axios.get('/api/insights');
        setInsights(res.data.data);
        setLoading(false);
      } catch (err) {
        console.error('Error fetching insights:', err);
        setError('Failed to load insights');
        setLoading(false);
      }
    };

    fetchInsights();
  }, []);

  const handleMarkAsRead = async (id) => {
    try {
      await axios.put(`/api/insights/${id}/read`);
      setInsights(insights.map(insight => 
        insight._id === id ? { ...insight, isRead: true } : insight
      ));
    } catch (err) {
      console.error('Error marking insight as read:', err);
    }
  };

  const handleActionTaken = async (id) => {
    try {
      await axios.put(`/api/insights/${id}/action`);
      setInsights(insights.map(insight => 
        insight._id === id ? { ...insight, isRead: true, actionTaken: true } : insight
      ));
    } catch (err) {
      console.error('Error marking action as taken:', err);
    }
  };

  // Format date to readable string
  const formatDate = (dateStr) => {
    const date = new Date(dateStr);
    return date.toLocaleDateString('en-US', {
      year: 'numeric',
      month: 'short',
      day: 'numeric'
    });
  };

  if (loading) {
    return (
      <div className="container mx-auto px-4 py-8">
        <div className="flex items-center justify-center min-h-[60vh]">
          <div className="w-12 h-12 border-4 border-primary-500 border-t-transparent rounded-full animate-spin"></div>
        </div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="container mx-auto px-4 py-8">
        <div className="bg-red-50 border border-red-400 text-red-700 px-4 py-3 rounded relative" role="alert">
          <strong className="font-bold">Error!</strong>
          <span className="block sm:inline"> {error}</span>
        </div>
      </div>
    );
  }

  return (
    <div className="container mx-auto px-4 py-8">
      <div className="md:flex md:items-center md:justify-between mb-8">
        <div className="flex-1 min-w-0">
          <h1 className="text-2xl font-bold leading-7 text-gray-900 sm:text-3xl sm:truncate">
            Health Insights
          </h1>
          <p className="mt-1 text-sm text-gray-500">
            AI-powered insights based on your health data
          </p>
        </div>
      </div>

      {insights.length === 0 ? (
        <div className="bg-white shadow overflow-hidden sm:rounded-lg p-6 text-center">
          <p className="text-gray-500">No insights available yet. Keep logging your health to get personalized insights!</p>
        </div>
      ) : (
        <div className="space-y-6">
          {insights.map((insight) => (
            <div key={insight._id} className={`bg-white shadow overflow-hidden sm:rounded-lg ${!insight.isRead ? 'border-l-4 border-primary-500' : ''}`}>
              <div className="px-4 py-5 sm:p-6">
                <div className="flex items-start">
                  <div className="flex-shrink-0">
                    {insight.insightType === 'alert' && (
                      <span className="inline-flex items-center justify-center h-10 w-10 rounded-md bg-red-100 text-red-600 text-xl">
                        ‚ö†Ô∏è
                      </span>
                    )}
                    {insight.insightType === 'pattern' && (
                      <span className="inline-flex items-center justify-center h-10 w-10 rounded-md bg-blue-100 text-blue-600 text-xl">
                        üîç
                      </span>
                    )}
                    {insight.insightType === 'suggestion' && (
                      <span className="inline-flex items-center justify-center h-10 w-10 rounded-md bg-green-100 text-green-600 text-xl">
                        üí°
                      </span>
                    )}
                    {insight.insightType === 'achievement' && (
                      <span className="inline-flex items-center justify-center h-10 w-10 rounded-md bg-yellow-100 text-yellow-600 text-xl">
                        üèÜ
                      </span>
                    )}
                  </div>
                  <div className="ml-4 flex-1">
                    <div className="flex justify-between">
                      <h3 className="text-lg leading-6 font-medium text-gray-900">{insight.title}</h3>
                      <p className="text-sm text-gray-500">{formatDate(insight.date)}</p>
                    </div>
                    <p className="mt-2 text-sm text-gray-500">{insight.description}</p>

                    {insight.suggestedActions && insight.suggestedActions.length > 0 && (
                      <div className="mt-3">
                        <h4 className="text-sm font-medium text-gray-700">Suggested Actions:</h4>
                        <ul className="mt-1 text-sm text-gray-500 list-disc list-inside">
                          {insight.suggestedActions.map((action, idx) => (
                            <li key={idx}>{action}</li>
                          ))}
                        </ul>
                      </div>
                    )}

                    <div className="mt-4 flex gap-2">
                      {!insight.isRead && (
                        <button
                          onClick={() => handleMarkAsRead(insight._id)}
                          className="inline-flex items-center px-3 py-1.5 border border-gray-300 text-xs font-medium rounded-md shadow-sm text-gray-700 bg-white hover:bg-gray-50 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-primary-500"
                        >
                          Mark as Read
                        </button>
                      )}
                      {!insight.actionTaken && (
                        <button
                          onClick={() => handleActionTaken(insight._id)}
                          className="inline-flex items-center px-3 py-1.5 border border-transparent text-xs font-medium rounded-md shadow-sm text-white bg-primary-600 hover:bg-primary-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-primary-500"
                        >
                          I've Done This
                        </button>
                      )}
                      {insight.actionTaken && (
                        <span className="inline-flex items-center px-2.5 py-0.5 rounded-md text-xs font-medium bg-green-100 text-green-800">
                          Action Completed
                        </span>
                      )}
                    </div>
                  </div>
                </div>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
}
